script: |
  super -f text -I q10093.spq | sort > q10093.out

inputs:
  - name: q10093.spq
    data: |
      SELECT DISTINCT ( - 28 ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q10093.out
    data: |
      -28
